insert into Food_CN(Food_Title,Food_Name,Description) values("BLT Cobb Salad","BLT 柯布沙拉","对待自己脆烟熏烟熏培根与真正的蓝奶酪碎、 煮熟的鸡蛋、 西红柿和牛油果牧场调料混合的味道。");
