insert into Food_CN(Food_Title,Food_Name,Description) values("Spicy Chicken Caesar Salad","香辣鸡肉凯撒沙拉","凯撒沙拉的方式应该是，用手工斩长叶莴苣，剃 asiago 奶酪和法式面包面包块。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Dave's Hot 'N Juicy 1/4 Lb Single","戴夫的热 ' N 多汁 1/4 磅单","四分之一磅的 100%真实北美牛肉和新鲜的溢价浇头上涂了黄油，烤馒头-我们新的黄金标准。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Dave's Hot 'N Juicy 1/2 Lb Double","戴夫的热 ' N 多汁 1/2 磅双","双起与半磅的 100%真实北美牛肉和新鲜的溢价浇头上涂了黄油，烤包子，双精度值，将会让戴夫感到骄傲。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Dave's Hot 'N Juicy 3/4 Lb Triple","戴夫的热 ' N 多汁 3/4 磅三","四分之三的 100%真实北美牛肉和更多的你都在渴望的新鲜溢价浇头一磅黄油，烤包子，保持你的汉堡包，更热、 更生动。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Bacon Deluxe Single","豪华单人间培根","三条顶热 ' n 多汁的牛肉小馅饼，定做每次上堆着高高的馥郁熏培根。添加美国奶酪，凉爽和脆蔬菜用少许调味品的爱和你已经得到了一个汉堡包来满足你的感官。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Bacon Deluxe Double","培根豪华大床房","两热 ' n 多汁所有牛肉饼都堆着三条馥郁烟熏培根。新鲜制作你的方式与美国奶酪、 作品、 蕃茄酱和蛋黄酱。现在，跳动你普通的汉堡包。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Baconator Single","Baconator 单","馥郁熏咸肉堆着高高顶新鲜、 不冻不淤，牛肉的 1/4 磅帕蒂。完成与片的美国奶酪，梅奥和番茄酱的一座山的令人垂涎的味道。去上有点困扰。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Baconator Double","Baconator 双","两个 1/4 磅肉饼配上多汁烟熏烟熏培根在保费上涂了黄油烤面包。配蛋黄酱、 番茄酱和美国奶酪。现在，不是只是一份三明治，而美味的食物。");
insert into Food_CN(Food_Title,Food_Name,Description) values("JBC (Jr. Bacon Cheeseburger)","JBC (小培根芝士汉堡）","还是你最喜欢培根芝士汉堡。只是有点小。同样伟大的热 ' n 多汁牛肉。满载美国奶酪和新鲜煮熟的、 厚切馥郁熏咸肉。保证满足。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Cheeseburger Deluxe","豪华汉堡","我们美味的热的 n 的多汁的牛肉肉饼配上所有的要点： 美国奶酪、 泡菜、 洋葱、 西红柿和生菜。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Double Cheeseburger Deluxe","双层芝士汉堡豪华","我们热 ' n 多汁的汉堡大小权利和配上你的最爱： 番茄酱、 芥末、 蛋黄酱、 洋葱、 泡菜、 生菜和西红柿。我们提到过的奶酪呢？。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Double Stack","双堆栈","两个初中汉堡碎肉饼配上美国奶酪、 番茄酱、 芥末酱、 腌菜和洋葱。当你命令它作新鲜。在口味上大、 小在价格上。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Cheesy Cheddarburger","潇洒 Cheddarburger","什么可能是比车打芝士汉堡更好？如何添加一层的美味的热 &amp; 神经中枢切达奶酪？当你命令它作新鲜。在口味上大、 小在价格上。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Cheeseburger Deluxe","豪华汉堡","我们美味的热的 n 的多汁的牛肉肉饼配上所有的要点： 美国奶酪、 泡菜、 洋葱、 西红柿和生菜。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Cheesy Cheddarburger","潇洒 Cheddarburger","什么可能是比车打芝士汉堡更好？如何添加一层的美味的热 &amp; 神经中枢切达奶酪？当你命令它作新鲜。在口味上大、 小在价格上。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Crispy Chicken Sandwich","香脆鸡肉三明治","配上脆生菜和奶油蛋黄酱，新鲜和美味的温迪的方式完成的招标，面包屑的鸡肉汉堡。脆皮鸡从来没有这么好。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Monterey Ranch Crispy Chicken Sandwich","蒙特利牧场脆皮鸡肉三明治","脆皮圆角的全白色肉鸡肉上面蒙特利杰克，新鲜的生菜和柠牧场酱。所有的只是 $0.99。不只将你的味蕾的感谢你，你的钱包会太。");
insert into Food_CN(Food_Title,Food_Name,Description) values("5-Piece Spicy Chicken Nuggets","5 块香辣鸡块","获取与五个片断的脆皮，全白色的肉、 鸡很小的价格大的香料。他们是令人垂涎的治疗与三种不同的辣椒和香的香料。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Crispy Chicken Caesar Wrap","脆皮鸡恺撒换行","经典品味新的转折。新鲜莴苣和卷心莴苣，自然剃 asiago 奶酪、 全天然凯撒酱和脆皮鸡里脊，包裹里面令人垂涎的凯撒味道在每一种美味的口软玉米饼。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Natural-Cut French Fries","自然切薯条","让我们面对它每个人都有炸薯条。温迪的有什么特别。自然切从整个赤褐色土豆，煮熟的皮肤上，和热脆与海盐，一尝真正的因为它获取。你已经有炸薯条。现在，尝试一些真正的星期五");
insert into Food_CN(Food_Title,Food_Name,Description) values("Sour Cream And Chive Potato","酸奶油和细香葱马铃薯","慢-在烤箱中烘焙，不该地在微波炉中加热。我们需要多说吗？我们的酸奶油和细香葱烤土豆是完美本身或搭配一个三明治。伟大的口味。巨大的价值。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Asiago Ranch Chicken Club","Asiago 牧场鸡肉俱乐部","这些不是一些无聊的劳什子鸡肉三明治。满足投标，全白色肉鸡肉鱼片配上厚切馥郁熏咸肉、 自然时效 asiago 奶酪、 奶油牧场酱、 手彩叶生菜和手-s 的温迪 asiago 大农场鸡俱乐部");
insert into Food_CN(Food_Title,Food_Name,Description) values("Spicy Chicken Sandwich","香辣鸡肉三明治","把它踢了几个缺口。我们添加我们自己火红的辣椒和香料的混合到您最喜爱的鸡胸肉圆角。配蛋黄酱、 生菜和红色的成熟的番茄。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Homestyle Chicken Fillet","家常鸡块","那里 s 我们签名鸡柳的事。专门调味，轻轻面包屑，上面有蛋黄酱。这奇特的鸟会离开你她更多。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Ultimate Chicken Grill","终极鸡肉烧烤","嫩烤整鸡胸脯里脊片美味的蜂蜜芥末酱和脆新鲜的浇头。所有味道只有 10 克的脂肪。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Monterey Ranch Crispy Chicken Sandwich","蒙特利牧场脆皮鸡肉三明治","脆皮圆角的全白色肉鸡肉上面蒙特利杰克，新鲜的生菜和柠牧场酱。所有的只是 $0.99。不只将你的味蕾的感谢你，你的钱包会太。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Crispy Chicken Sandwich","香脆鸡肉三明治","配上脆生菜和奶油蛋黄酱，新鲜和美味的温迪的方式完成的招标，面包屑的鸡肉汉堡。脆皮鸡从来没有这么好。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Crispy Chicken Caesar Wrap","脆皮鸡恺撒换行","经典品味新的转折。新鲜莴苣和卷心莴苣，自然剃 asiago 奶酪、 全天然凯撒酱和脆皮鸡里脊，包裹里面令人垂涎的凯撒味道在每一种美味的口软玉米饼。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Spicy Chicken Go Wrap","香辣鸡去换行","我们最喜欢鸡块用火红的辣椒和香料的混合。再加上脆生菜，切达干酪和柠牧场酱所有包裹在玉米饼。认为它是 wrappetizer。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Homestyle Chicken Go Wrap","家常鸡去换行","我们签名鸡胸肉圆角特别丰富和酥脆。再加上脆生菜，切达干酪和柠牧场酱所有包裹在玉米饼。认为这是 wrappetizer。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Grilled Chicken Go Wrap","烤鸡去换行","我们最终鸡烤鱼片脆生菜、 切达干酪和蜂蜜芥末酱所有包裹在玉米饼打扮。认为它是 wrappetizer。");
insert into Food_CN(Food_Title,Food_Name,Description) values("5-piece Chicken Nuggets","5 块鸡块","用你的手指吃。脆皮外，多汁内，温迪的鸡块是全白色肉。你选择酱汁： 烧烤、 蜂蜜芥末、 甜、 酸、 牧场或蜂蜜。");
insert into Food_CN(Food_Title,Food_Name,Description) values("10-Piece Chicken Nuggets","10 块鸡块","甚至更多的你爱的掘金队。脆皮，所有-白色的肉，superlicious 鸡咬与 2 勺型的你最喜欢的酱汁： 烧烤、 蜂蜜芥末、 甜、 酸、 牧场或蜂蜜。");
insert into Food_CN(Food_Title,Food_Name,Description) values("5-piece Spicy Chicken Nuggets","5 块香辣鸡块","获取与五个片断的脆皮，全白色的肉、 鸡很小的价格大的香料。他们是令人垂涎的治疗与三种不同的辣椒和香的香料。");
insert into Food_CN(Food_Title,Food_Name,Description) values("10-Piece Spicy Chicken Nuggets","10 块香辣鸡块","你的香料相处的脆皮，全白色肉鸡块，你渴望的两倍。这就像为你的嘴巴用三种不同的辣椒的辛辣味爆炸和咸味香料什么乐趣。");
