insert into Food_CN(Food_Title,Food_Name,Description) values("Garden Side Salad","花园沙拉","脆脆脆和只是合适的尺寸。视觉的新鲜度。沙拉和所有您的收藏夹： 甜、 多汁的葡萄西红柿和胡萝卜切丝掺。最重要的是与我们的敷料，包括一些美味的打火机选择的任何一个。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Sour Cream And Chive Potato","酸奶油和细香葱马铃薯","慢-在烤箱中烘焙，不该地在微波炉中加热。我们需要多说吗？我们的酸奶油和细香葱烤土豆是完美本身或搭配一个三明治。伟大的口味。巨大的价值。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Broccoli Cheese Potato","西兰花奶酪土豆","美味的方式来获得你的蔬菜。管道的热烤土豆直接从烤箱里配上鲜嫩的西兰花和奶油乳酪酱。站立独自或与任何三明治。在选择餐厅可用。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Bacon Cheese Potato","培根奶酪土豆","热身到丰富的奶油芝士和馥郁熏咸肉我们美味的烤土豆上与众不同的品味。它 s 只是权利选择吃午餐，晚餐或深夜小吃。在选择餐厅可用。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Chili","红辣椒","我们辣椒 s 品味屡获殊荣。到丰富和肉辣椒一壶腹部那 s 低脂肪、 高纤维。良好的口感和好吧，太。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Apple Slices","苹果片","令人垂涎的苹果切片是一个伟大的营养选择和极好的维生素 c.来源吃一些每一天，医生远离我。");
