insert into Food_CN(Food_Title,Food_Name,Description) values("The New Oreo Frosty Parfait","新的奥利奥严寒冻糕","我们的凉爽，奶油 vanills 霜混合的奥利奥饼干片和完成了与丰富的牛奶巧克力糖浆。它是浇水最喜欢嘴。");
insert into Food_CN(Food_Title,Food_Name,Description) values("The Original Chocolate Frosty","原始的巧克力霜","很酷，奶油，令人耳目一新。用 100%的可可粉，真正的牛奶和奶油，没有什么比这原始的温迪 s 更满足。");
insert into Food_CN(Food_Title,Food_Name,Description) values("The Original Vanilla Frosty","原始的香草霜","风味，每个人都喜欢在阴凉，奶油，真实的可能只是温迪 s 的牛奶乳制品甜点。");
insert into Food_CN(Food_Title,Food_Name,Description) values("The Caramel Frosty Shake","焦糖霜摇","焦糖为你疯狂吗？然后我们 ve 有你请客。在我们与真实焦糖混合霜我们经典的手工纺摇上的 sip 酱它 s 完美又香又甜。");
insert into Food_CN(Food_Title,Food_Name,Description) values("The Chocolate Frosty Shake","巧克力霜摇","在你的勺子稻草和 sip 对此贸易。我们开始与我们结霜的经典。再拌入可口可可。把它们放在一起，和你有一尝起来像没有其他你 ve 才的手纺摇。");
insert into Food_CN(Food_Title,Food_Name,Description) values("The Starwberry Frosty Shake","Starwberry 霜摇","撼动你的一天。我们从真实草莓甜蜜和外奶油的手纺甜点做成酱混合我们经典霜。它 s 摇整个新的采取。");
insert into Food_CN(Food_Title,Food_Name,Description) values("The Vanilla Frosty Shake","香草霜摇","我们经典的霜手纺奶油香草的超级新鲜的甜点，味道像你已经在之前没有其他摇。");
insert into Food_CN(Food_Title,Food_Name,Description) values("The Wild Berry Frosty Shake","野生浆果霜摇","爱一点果味混合吗？然后给自己冷若冰霜，我们经典的手纺与真正的草莓、 黑莓和覆盆子的混合。它 s 甜，可口的善良，直接从你的稻草。");
