insert into Food_CN(Food_Title,Food_Name,Description) values("Orange Chicken","陈皮鸡","橙色鸡是菜，湖南省的鼓舞中国的中南部。它被准备与脆皮无骨鸡叮咬，我们秘密的甜和辣橙色汁下锅的。安迪给带来了这个主菜的熊猫的很自己行政总厨");
insert into Food_CN(Food_Title,Food_Name,Description) values("Sweetfire Chicken Breast","Sweetfire 鸡胸肉","Sweetfire 鸡胸脯特点酥脆，肉白鸡叮咬扔进了一锅与红柿子椒、 切丁的洋葱和多汁菠萝乌冬的甜辣汁泰国风味的鼓舞。");
insert into Food_CN(Food_Title,Food_Name,Description) values("String Bean Chicken Breast","四季豆鸡胸脯肉","四季豆鸡胸脯肉是由广东省在中国的南部海岸上的启发的广东菜。它被准备与腌制的鸡胸肉、 鲜切四季豆和切好的洋葱，用温和的姜酱油下锅的。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Kung Pao Chicken","宫保鸡丁","宫保鸡丁是辣炒菜，灵感源自四川省在中国中部。它被准备与腌好的鸡丁、 脆脆花生、 丁红柿子椒和西葫芦切片，全部丢进新鲜的葱炒。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Mandarin Chicken","文华鸡","文华鸡是由北京城在中国的东北菜，启发。它是准备烤的鸡肉条带和服务与我们的甜和风味的普通话酱。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Mushroom Chicken","香菇鸡肉","蘑菇鸡是广东省在中国的南部海岸的鼓舞的广东菜。它准备与腌制宫保鸡丁，西葫芦切片和蘑菇，用温和的姜酱油锅中所有抛出。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Black Pepper Chicken","黑胡椒鸡","黑胡椒鸡是一道传统菜灵感来自湖南省中国的中南部。它准备用腌好的鸡丁，切碎的芹菜，切洋葱和新鲜黑胡椒粉，用温和的姜酱油下锅的。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Beijing Beef","北京牛肉","北京牛肉的灵感灵感来自中国中部的四川风格菜。它准备腌的牛肉、 青椒和切好的洋葱，扑鼻的甜和辣汁下锅的脆条带。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Shanghai Angus Steak","上海安格斯牛排","上海安格斯牛排特点厚切片的腌制安格斯顶级沙朗脆芦笋，新鲜切的蘑菇，所有锅扔在我们新的柠亚洲牛排酱。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Broccoli Beef","西兰花牛肉","西兰花牛肉是广东菜，广东省在中国的南部海岸上的鼓舞。它被准备与腌好的牛肉片和新鲜的西兰花，用温和的姜酱油下锅的。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Honey Walnut Shrimp","蜂蜜核桃虾","蜂蜜核桃虾是一道菜灵感来自的上海的海边。它的特点新鲜天妇罗虾锅扔在美食蜜汁和配上釉面核桃。这是甜的一个令人垂涎的组合又脆。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Peppercorn Shrimp","胡椒虾","胡椒虾被准备与腌的虾、 鲜芦笋和红椒的所有锅扔与在我们乌冬的泰式胡椒汁切好的洋葱。");
insert into Food_CN(Food_Title,Food_Name,Description) values("BBQ Pork","烧烤猪肉","烧烤猪肉是广东菜，广东省在中国的南部海岸的鼓舞。我们在我们自己中国烧烤酱慢烤嫩猪肉。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Sweet & Sour Pork","甜甜 &amp; 糖醋里脊","甜甜 &amp; 酸猪肉是菜，灵感由上海位于中国的中部海岸的城市。它与脆皮猪肉叮咬以及青椒，切好的洋葱和多汁的特征我们特别甜的和酸汁下锅的准备");
insert into Food_CN(Food_Title,Food_Name,Description) values("Eggplant Tofu","茄子豆腐","茄子豆腐是我国中部轻轻褐色的豆腐、 鲜茄子、 丁红柿子椒，用甜甜的和辣的酱汁下锅的菜，灵感来自四川省。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Mixed Veggies","混合的蔬菜","混合的蔬菜是新鲜的西兰花、 西葫芦、 胡萝卜、 四季豆、 大白菜炒组合。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Chow Mein","炒面","炒面被准备与我们的面条，用切碎的洋葱、 脆芹菜和新鲜的卷心菜下锅的。");
insert into Food_CN(Food_Title,Food_Name,Description) values("Fried Rice","炒饭","炒饭被准备着用扔在酱油、 炒鸡蛋、 青豆、 胡萝卜和葱油锅内的蒸米。");
